import React from "react";

const Factory = () => {
  return (
    <img
      src="gif/factory.gif"
      className="absolute z-0 md:block hidden"
      style={{
        height: "100vh",
        transform: "rotate(-15deg)",
        top: "20%",
        marginTop: "-30vh",
        left: "90%",
        marginLeft: "-35vh",
      }}
      alt="factory"
    />
  );
};

export default Factory;
